I am a passionate Product Designer (UX/UI) with over 40 successful projects (websites, applications, various CRM systems, catering services, banking applications and systems, medical products, government products). I enjoy creating modern interfaces that turn broad problems into simple, user-friendly solutions. Identifying innovative approaches and improved solutions through immersion in business logic both motivate and drive me.

I can:
⁃ UX/UI Design, Product Design;
⁃ Create customer empathy, stakeholder, journey maps and describe the main goal of the product;
⁃ Transform hypotheses into a scenario to understand the customers’ needs;
⁃ Prioritize tasks and sort them by priority;
⁃ Make visual designs for web, kiosk, and mobile (iOS/Android);
⁃ Prepare materials for developers, detailed scenarios of design solutions, work with UI kit;
⁃ Conduct customer interviews, usability, user testing, and other forms of requirements discovery;
- Make successful hypotheses, experiments, analytics;
⁃ Conduct A/B tests;
⁃ Use Agile methodologies, including modeling experience using task/storyboards;
⁃ Understand marketing analysis of competitive products on the market);
- Solve user problems and improve customer business;
⁃ Promote and develop designers in the Design Chapter;
⁃ Support and management of design processes by JIRA Atlassian system;

– PhD in Data Science/Machine Learning; 12+ years of industry and academic research experience;
– 10+ years of practical experience in Machine Learning, Deep Learning, Big Data and AI project development;
– 15+ years of software development.

Проект под название "Öyrət" носит образовательный характер и нацелен на то, чтобы:
-повысить вовлеченность молодежи в сферу образования;
-внедрить онлайн-образование в регионах Азербайджана;
-дать возможность родителям, школьникам, студентам быстро находить преподавателей;

Суть проекта заключается в том, что на данной платформе у преподавателей  будет возможность предлагать свои педагогические услуги. Услуги могут включать:
-выполнение домашнего задания с учеником, студентом;
-преподавание языков;
-обучение определенным наукам и т.д.

У каждого преподавателя будет профиль, куда он должен внести свои данные, рекомендации, на основе этих данных клиенты (родители, студенты) смогу выбрать учителя под свои потребности. Оплата будет осуществляться почасовая с помощью безналичной оплаты на самом сайте. 
Платформа будет в виде сайта, так и приложения.
